import React from "react";
import { Link, withRouter } from "react-router-dom";

const PlanReact = (props) => {

    const { match: { url } } = props;

    return (<div>
        <h1>React</h1>

        <Link to={`${url}/jsx`}>
            Jsx
        </Link>
        <Link to={`${url}/Hooks`}>
            Hooks
        </Link>
    </div>)
}

export default withRouter(PlanReact);
